// Custom code to play the animations...
function start() {
    var viewport = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);
    var playerWidth = 420;

    if (viewport < 375) {
        playerWidth = 240;
    } else if (viewport >= 375 && viewport < 769) {
        playerWidth = 281;
    }

    var playerHeight = playerWidth * 0.5625;

    var queryParams = (function () {
        var params = {};
        location.search.substring(1).split('&').forEach(function (item) {
            var temp = item.split('=');
            if (temp[0]) params[temp[0]] = temp[1];
        });
        return params;
    })();


    var playerParams = {
        width: playerWidth,
        height: playerHeight,
        autoPlay: true,
        repeat: true,
        controlsEnabled: false,
        speed: 0.6
    };

    var targets = ["anim-node", "anim-hadoop", "anim-lamar", "anim-cgi", "anim-ruby"];

    targets.forEach(function (v) {
        var WRAPPER_ID = v;
        var wrapper = document.getElementById(WRAPPER_ID);

        var animation = animData[v];

        if ('anm' in window) {
            anm.createPlayer(WRAPPER_ID, playerParams)
                .load(animation,
                anm.importers.create('animatron'));
        } else if ('animatron' in window) {
            animatron.createPlayer(WRAPPER_ID, playerParams)
                .load(animation);
        }

        wrapper.style.width = playerParams.width + 'px';
        
        if(playerHeight < 200) {
            wrapper.style.height = playerParams.height + 55 + 'px';    
        }

    });
}

window.addEventListener("load", start);



